import React, { Component } from 'react';
import {PostContainer} from './containers';
import { Header } from './components';
import SignUp from './components/SignUp/SignUp';

class App extends Component {
  render() {
    return (
        <div align="center">
            <Header/>
            <PostContainer/>
            <SignUp/>
        </div>
    );
  }
}

export default App;
